import React, { useEffect, useRef, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const navigate = useNavigate();
  const topRightContainerRef = useRef(null);
  const [userInfo, setUserInfo] = useState({
    name: 'John Doe',
    username: 'johndoe123',
    profilePicture: 'https://via.placeholder.com/40', // Placeholder image
  });

  useEffect(() => {
    // Dynamically position the top-right container
    const container = topRightContainerRef.current;
    if (container) {
      container.style.position = 'absolute';
      container.style.top = '20px';
      container.style.right = '20px';
      container.style.display = 'flex';
      container.style.alignItems = 'center';
      container.style.gap = '15px';
    }
  }, []);

  const handleViewClubs = () => {
    navigate('/clubs');
  };

  const handleViewEvents = () => {
    navigate('/events');
  };

  const handleViewResources = () => {
    navigate('/resources');
  };

  const handleDeleteAccount = () => {
    navigate('/delete-account');
  };

  const handleLogout = () => {
    navigate('/logout');
  };

  return (
    <div style={styles.container}>
      {/* Top-right user information and actions */}
      <div ref={topRightContainerRef} style={styles.topRightContainer}>
        <div style={styles.userInfoContainer}>
          <img
            src={userInfo.profilePicture}
            alt="Profile"
            style={styles.profilePicture}
          />
          <span style={styles.username}>{userInfo.username}</span>
        </div>
        <div style={styles.actionsContainer}>
          <button onClick={handleDeleteAccount} style={styles.deleteAccountButton}>
            Delete Account
          </button>
          <button onClick={handleLogout} style={styles.logoutButton}>
            Logout
          </button>
        </div>
      </div>

      {/* Header */}
      <header style={styles.header}>
        <h1 style={styles.headerTitle}>Welcome to Your Dashboard</h1>
      </header>

      {/* Main Content */}
      <div style={styles.contentContainer}>
        <div style={styles.card} onClick={handleViewClubs}>
          <h2 style={styles.cardTitle}>Clubs</h2>
          <p style={styles.cardDescription}>View and manage all your clubs.</p>
        </div>
        <div style={styles.card} onClick={handleViewEvents}>
          <h2 style={styles.cardTitle}>Events</h2>
          <p style={styles.cardDescription}>See and join upcoming events.</p>
        </div>
        <div style={styles.card} onClick={handleViewResources}>
          <h2 style={styles.cardTitle}>Resources</h2>
          <p style={styles.cardDescription}>Access shared resources and materials.</p>
        </div>
      </div>

      {/* Footer */}
      <footer style={styles.footer}>
        <p style={styles.footerText}>© 2024 Your Company. All rights reserved.</p>
      </footer>
    </div>
  );
};

// Refined inline styles for the dashboard (with a more polished, modern look)
const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    height: '100vh',
    background: 'linear-gradient(135deg, #f0f4f8, #d9e2f3)',
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    color: '#333',
    boxSizing: 'border-box',
    paddingTop: '50px', // Added space to prevent content overlap
  },
  topRightContainer: {
    position: 'absolute',
    top: '20px',
    right: '20px',
    display: 'flex',
    alignItems: 'center',
    gap: '15px',
    zIndex: 10, // Ensure it's above other elements
  },
  userInfoContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '10px',
  },
  profilePicture: {
    width: '40px',
    height: '40px',
    borderRadius: '50%',
    objectFit: 'cover',
  },
  username: {
    fontSize: '16px',
    fontWeight: '600',
    color: '#2c3e50',
  },
  actionsContainer: {
    display: 'flex',
    gap: '10px',
  },
  deleteAccountButton: {
    padding: '10px 15px',
    backgroundColor: '#e74c3c',
    color: '#fff',
    border: 'none',
    borderRadius: '25px',
    cursor: 'pointer',
    fontSize: '14px',
    transition: 'background-color 0.3s ease, transform 0.3s ease',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  logoutButton: {
    padding: '10px 15px',
    backgroundColor: '#7f8c8d',
    color: '#fff',
    border: 'none',
    borderRadius: '25px',
    cursor: 'pointer',
    fontSize: '14px',
    transition: 'background-color 0.3s ease, transform 0.3s ease',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  header: {
    backgroundColor: '#3498db',
    color: '#fff',
    padding: '50px 20px',
    textAlign: 'center',
    boxShadow: '0 2px 5px rgba(0, 0, 0, 0.1)',
    marginBottom: '40px',
    borderBottomLeftRadius: '30px',
    borderBottomRightRadius: '30px',
  },
  headerTitle: {
    margin: 0,
    fontSize: '32px',
    fontWeight: '600',
  },
  contentContainer: {
    display: 'flex',
    justifyContent: 'center',
    gap: '30px',
    padding: '40px 20px',
    flexWrap: 'wrap',
    alignItems: 'center',
  },
  card: {
    backgroundColor: '#fff',
    padding: '30px 20px',
    borderRadius: '15px',
    boxShadow: '0 4px 12px rgba(0, 0, 0, 0.1)',
    cursor: 'pointer',
    width: '250px',
    transition: 'transform 0.3s ease, box-shadow 0.3s ease',
    marginBottom: '30px',
    textAlign: 'center',
  },
  cardTitle: {
    fontSize: '20px',
    color: '#2c3e50',
    fontWeight: '600',
  },
  cardDescription: {
    fontSize: '16px',
    color: '#7f8c8d',
    marginTop: '10px',
  },
  footer: {
    backgroundColor: '#2c3e50',
    color: '#fff',
    textAlign: 'center',
    padding: '20px 0',
    position: 'absolute',
    bottom: '0',
    width: '100%',
    borderTopLeftRadius: '30px',
    borderTopRightRadius: '30px',
  },
  footerText: {
    margin: 0,
    fontSize: '14px',
  },
};

export default Dashboard;
